// src/components/Header.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import '../pages/Header.css'; // Optional: Import a CSS file for styling
import Latest from '../pages/Latest';
function Header() {
    return (
        <header>
      <a href="#" class="logo"
        ><img src="/assets/logo.png" width="200px" height="110px"
      /></a>
      <ul class="navigation">
      <li><Link to="/">Home</Link></li>
      <li><Link to="/">Latest</Link></li>
        <li><a href="latest.html">LATEST</a></li>
        <li><a href="contact.html">CONTACT US</a></li>
        <li><a href="questionnaire.html">QUESTIONNAIRE</a></li>
        <li><a href="login.html">LOGIN</a></li>
      </ul>
      <div class="navtabs">
        <a href="">Follow us</a>
        <a href="https://www.instagram.com/" target="_blank"
          ><i class="ri-instagram-fill"></i
        ></a>
        <a href="https://x.com/"><i class="ri-twitter-x-fill"></i></a>
        <a href="https://www.facebook.com/"><i class="ri-facebook-fill"></i></a>
        <div class="bx bx-menu" id="menu"></div>
      </div>
    </header>
    );
}

export default Header;
